interface SCDN {
    /**
     * 调用DescribeScdnService查询SCDN服务状态。包括：服务开通时间，频次攻击保护等数据。
     */
    DescribeScdnService(query: DescribeScdnServiceRequest): Promise<DescribeScdnServiceResponse>;
    /**
     * 查询SCDN是否开通，是否欠费。
     */
    CheckScdnService(query: CheckScdnServiceRequest): Promise<CheckScdnServiceResponse>;
    /**
     * 调用DescribeScdnUserProtectInfo查询用户开通的服务信息。
     */
    DescribeScdnUserProtectInfo(query: DescribeScdnUserProtectInfoRequest): Promise<DescribeScdnUserProtectInfoResponse>;
    /**
     * 调用DescribeScdnUserQuota查询用户资源上限及已使用情况。
     */
    DescribeScdnUserQuota(query: DescribeScdnUserQuotaRequest): Promise<DescribeScdnUserQuotaResponse>;
    /**
     * 调用DescribeScdnDomainDetail获取指定加速域名配置的基本信息。
     */
    DescribeScdnDomainDetail(query: DescribeScdnDomainDetailRequest): Promise<DescribeScdnDomainDetailResponse>;
    /**
     * 查询用户名下所有的安全加速域名。支持域名模糊匹配过滤和域名状态过滤。
     */
    DescribeScdnUserDomains(query: DescribeScdnUserDomainsRequest): Promise<DescribeScdnUserDomainsResponse>;
    /**
     * 调用AddScdnDomain添加安全加速域名。
     */
    AddScdnDomain(query: AddScdnDomainRequest): Promise<AddScdnDomainResponse>;
    /**
     * 调用UpdateScdnDomain修改加速域名配置。
     */
    UpdateScdnDomain(query: UpdateScdnDomainRequest): Promise<UpdateScdnDomainResponse>;
    /**
     * 调用BatchDeleteScdnDomainConfigs批量删除域名配置。
     */
    BatchDeleteScdnDomainConfigs(query: BatchDeleteScdnDomainConfigsRequest): Promise<BatchDeleteScdnDomainConfigsResponse>;
    /**
     * 调用DescribeScdnDomainCertificateInfo获取指定加速域名证书信息。
     */
    DescribeScdnDomainCertificateInfo(query: DescribeScdnDomainCertificateInfoRequest): Promise<DescribeScdnDomainCertificateInfoResponse>;
    /**
     * 检测用户是否完成Cname，支持多个域名。
     */
    DescribeScdnDomainCname(query: DescribeScdnDomainCnameRequest): Promise<DescribeScdnDomainCnameResponse>;
    /**
     * 调用BatchUpdateScdnDomain批量更新安全加速域名。
     */
    BatchUpdateScdnDomain(query: BatchUpdateScdnDomainRequest): Promise<BatchUpdateScdnDomainResponse>;
    /**
     * 停用某个加速域名，将DomainStatus变更为offline。
     */
    StopScdnDomain(query: StopScdnDomainRequest): Promise<StopScdnDomainResponse>;
    /**
     * 调用DeleteScdnDomain删除已添加的加速域名。
     */
    DeleteScdnDomain(query: DeleteScdnDomainRequest): Promise<DeleteScdnDomainResponse>;
    /**
     * 启用状态为“停用”的加速域名，将DomainStatus变更为online。
     */
    StartScdnDomain(query: StartScdnDomainRequest): Promise<StartScdnDomainResponse>;
    /**
     * 调用BatchStartScdnDomain启用状态为“停用”的加速域名。
     */
    BatchStartScdnDomain(query: BatchStartScdnDomainRequest): Promise<BatchStartScdnDomainResponse>;
    /**
     * 调用BatchStopScdnDomain停用加速域名。
     */
    BatchStopScdnDomain(query: BatchStopScdnDomainRequest): Promise<BatchStopScdnDomainResponse>;
    /**
     * 调用DescribeScdnDDoSInfo查询DDoS防护信息。
     */
    DescribeScdnDDoSInfo(query: DescribeScdnDDoSInfoRequest): Promise<DescribeScdnDDoSInfoResponse>;
    /**
     * 调用SetScdnDDoSInfo设置网络攻击弹性防护带宽。
     */
    SetScdnDDoSInfo(query: SetScdnDDoSInfoRequest): Promise<SetScdnDDoSInfoResponse>;
    /**
     * 可查询多个功能配置。
     */
    DescribeScdnDomainConfigs(query: DescribeScdnDomainConfigsRequest): Promise<DescribeScdnDomainConfigsResponse>;
    /**
     * 查询频次控制防护功能信息。
     */
    DescribeScdnCcInfo(query: DescribeScdnCcInfoRequest): Promise<DescribeScdnCcInfoResponse>;
    /**
     * 调用SetScdnCcInfo设置频次防护功能。
     */
    SetScdnCcInfo(query: SetScdnCcInfoRequest): Promise<SetScdnCcInfoResponse>;
    /**
     * 调用DeleteScdnSpecificConfig删除加速域名的配置。
     */
    DeleteScdnSpecificConfig(query: DeleteScdnSpecificConfigRequest): Promise<DeleteScdnSpecificConfigResponse>;
    /**
     * 调用DescribeScdnCertificateList获取证书列表信息。
     */
    DescribeScdnCertificateList(query: DescribeScdnCertificateListRequest): Promise<DescribeScdnCertificateListResponse>;
    /**
     * 调用BatchSetScdnDomainConfigs批量配置域名。
     */
    BatchSetScdnDomainConfigs(query: BatchSetScdnDomainConfigsRequest): Promise<BatchSetScdnDomainConfigsResponse>;
    /**
     * 调用DescribeScdnCertificateDetail获取证书详细信息。
     */
    DescribeScdnCertificateDetail(query: DescribeScdnCertificateDetailRequest): Promise<DescribeScdnCertificateDetailResponse>;
    /**
     * 设置某域名下证书功能是否启用及修改证书信息。
     */
    SetScdnDomainCertificate(query: SetScdnDomainCertificateRequest): Promise<SetScdnDomainCertificateResponse>;
    /**
     * 调用SetScdnBotInfo设置bot防护功能。
     */
    SetScdnBotInfo(query: SetScdnBotInfoRequest): Promise<SetScdnBotInfoResponse>;
    /**
     * 调用DescribeScdnRefreshQuota查询刷新预热次数限制和余量。
     */
    DescribeScdnRefreshQuota(query: DescribeScdnRefreshQuotaRequest): Promise<DescribeScdnRefreshQuotaResponse>;
    /**
     * 刷新节点上的文件内容，刷新指定URL内容至Cache节点，支持URL批量刷新。
     */
    RefreshScdnObjectCaches(query: RefreshScdnObjectCachesRequest): Promise<RefreshScdnObjectCachesResponse>;
    /**
     * 调用PreloadScdnObjectCaches将源站的内容主动预热到L2 Cache节点上，用户首次访问可直接命中缓存，缓解源站压力。
     */
    PreloadScdnObjectCaches(query: PreloadScdnObjectCachesRequest): Promise<PreloadScdnObjectCachesResponse>;
    /**
     * 调用DescribeScdnRefreshTasks查询刷新、预热状态是否在全网生效。
     */
    DescribeScdnRefreshTasks(query: DescribeScdnRefreshTasksRequest): Promise<DescribeScdnRefreshTasksResponse>;
    /**
     * 查询网络监控数据。
     */
    DescribeScdnDDoSTrafficInfo(query: DescribeScdnDDoSTrafficInfoRequest): Promise<DescribeScdnDDoSTrafficInfoResponse>;
    /**
     * 调用DescribeScdnCcQpsInfo查询频次监控数据。
     */
    DescribeScdnCcQpsInfo(query: DescribeScdnCcQpsInfoRequest): Promise<DescribeScdnCcQpsInfoResponse>;
    /**
     * 获取安全加速域名指定时间段之内的频次攻击IP信息。
     */
    DescribeScdnCcTopIp(query: DescribeScdnCcTopIpRequest): Promise<DescribeScdnCcTopIpResponse>;
    /**
     * 获取安全加速域名指定时间段之内的频次攻击URL信息。
     */
    DescribeScdnCcTopUrl(query: DescribeScdnCcTopUrlRequest): Promise<DescribeScdnCcTopUrlResponse>;
    /**
     * 调用DescribeScdnDomainBpsData获取安全加速域名的网络带宽监控数据。
     */
    DescribeScdnDomainBpsData(query: DescribeScdnDomainBpsDataRequest): Promise<DescribeScdnDomainBpsDataResponse>;
    /**
     * 获取安全加速域名的网络流量监控数据，单位byte。
     */
    DescribeScdnDomainTrafficData(query: DescribeScdnDomainTrafficDataRequest): Promise<DescribeScdnDomainTrafficDataResponse>;
    /**
     * 调用DescribeScdnDomainOriginBpsData获取安全加速域名的回源带宽监控数据。
     */
    DescribeScdnDomainOriginBpsData(query: DescribeScdnDomainOriginBpsDataRequest): Promise<DescribeScdnDomainOriginBpsDataResponse>;
    /**
     * 获取安全加速域名的回源流量监控数据，单位bit。
     */
    DescribeScdnDomainOriginTrafficData(query: DescribeScdnDomainOriginTrafficDataRequest): Promise<DescribeScdnDomainOriginTrafficDataResponse>;
    /**
     * 调用DescribeScdnDomainQpsData获取安全加速域名的每秒访问次数QPS。
     */
    DescribeScdnDomainQpsData(query: DescribeScdnDomainQpsDataRequest): Promise<DescribeScdnDomainQpsDataResponse>;
    /**
     * 获取安全加速域名的命中率，包括字节命中率和请求命中率。
     */
    DescribeScdnDomainHitRateData(query: DescribeScdnDomainHitRateDataRequest): Promise<DescribeScdnDomainHitRateDataResponse>;
    /**
     * 获取安全加速域名最小5分钟粒度的HTTP返回码占比数据。
     */
    DescribeScdnDomainHttpCodeData(query: DescribeScdnDomainHttpCodeDataRequest): Promise<DescribeScdnDomainHttpCodeDataResponse>;
    /**
     * 获取加速域名的天粒度的用户运营商分布数据的统计。
     */
    DescribeScdnDomainIspData(query: DescribeScdnDomainIspDataRequest): Promise<DescribeScdnDomainIspDataResponse>;
    /**
     * 获取加速域名天粒度的用户区域分布的数据统计。
     */
    DescribeScdnDomainRegionData(query: DescribeScdnDomainRegionDataRequest): Promise<DescribeScdnDomainRegionDataResponse>;
    /**
     * 获取加速域名最小1小时粒度的PV页面访问的统计数据。
     */
    DescribeScdnDomainPvData(query: DescribeScdnDomainPvDataRequest): Promise<DescribeScdnDomainPvDataResponse>;
    /**
     * 获取加速域名最小1小时粒度的UV页面独立访问的统计数据。
     */
    DescribeScdnDomainUvData(query: DescribeScdnDomainUvDataRequest): Promise<DescribeScdnDomainUvDataResponse>;
    /**
     * 调用DescribeScdnDomainTopUrlVisit获取加速域名某天内的热门URL列表。
     */
    DescribeScdnDomainTopUrlVisit(query: DescribeScdnDomainTopUrlVisitRequest): Promise<DescribeScdnDomainTopUrlVisitResponse>;
    /**
     * 获取加速域名某天的热门页面引用次数排名。
     */
    DescribeScdnDomainTopReferVisit(query: DescribeScdnDomainTopReferVisitRequest): Promise<DescribeScdnDomainTopReferVisitResponse>;
    /**
     * 调用DescribeScdnDomainRealTimeBpsData获取域名1分钟粒度带宽数据。
     */
    DescribeScdnDomainRealTimeBpsData(query: DescribeScdnDomainRealTimeBpsDataRequest): Promise<DescribeScdnDomainRealTimeBpsDataResponse>;
    /**
     * 获取加速域名1分钟粒度的HTTP返回码占比数据。
     */
    DescribeScdnDomainRealTimeHttpCodeData(query: DescribeScdnDomainRealTimeHttpCodeDataRequest): Promise<DescribeScdnDomainRealTimeHttpCodeDataResponse>;
    /**
     * 调用DescribeScdnDomainRealTimeQpsData获取域名1分钟粒度每秒访问次数的数据。
     */
    DescribeScdnDomainRealTimeQpsData(query: DescribeScdnDomainRealTimeQpsDataRequest): Promise<DescribeScdnDomainRealTimeQpsDataResponse>;
    /**
     * 调用DescribeScdnDomainRealTimeSrcBpsData获取域名一分钟粒度回源带宽的数据。
     */
    DescribeScdnDomainRealTimeSrcBpsData(query: DescribeScdnDomainRealTimeSrcBpsDataRequest): Promise<DescribeScdnDomainRealTimeSrcBpsDataResponse>;
    /**
     * 获取加速域名的1分钟回源流量监控数据，单位bit。
     */
    DescribeScdnDomainRealTimeSrcTrafficData(query: DescribeScdnDomainRealTimeSrcTrafficDataRequest): Promise<DescribeScdnDomainRealTimeSrcTrafficDataResponse>;
    /**
     * 调用DescribeScdnDomainRealTimeByteHitRateData获取域名1分钟粒度字节命中率的数据。
     */
    DescribeScdnDomainRealTimeByteHitRateData(query: DescribeScdnDomainRealTimeByteHitRateDataRequest): Promise<DescribeScdnDomainRealTimeByteHitRateDataResponse>;
    /**
     * 调用DescribeScdnDomainRealTimeReqHitRateData获取域名1分钟粒度请求命中率的数据。
     */
    DescribeScdnDomainRealTimeReqHitRateData(query: DescribeScdnDomainRealTimeReqHitRateDataRequest): Promise<DescribeScdnDomainRealTimeReqHitRateDataResponse>;
    /**
     * 获取加速域名的1分钟回源流量监控数据，单位bit。
     */
    DescribeScdnDomainRealTimeTrafficData(query: DescribeScdnDomainRealTimeTrafficDataRequest): Promise<DescribeScdnDomainRealTimeTrafficDataResponse>;
    /**
     * 调用DescribeDcdnTopDomainsByFlow获取用户按流量排名的域名。
     */
    DescribeScdnTopDomainsByFlow(query: DescribeScdnTopDomainsByFlowRequest): Promise<DescribeScdnTopDomainsByFlowResponse>;
    /**
     * 调用DescribeScdnDomainLog获取指定域名原始访问日志的下载地址。
     */
    DescribeScdnDomainLog(query: DescribeScdnDomainLogRequest): Promise<DescribeScdnDomainLogResponse>;
    DescribeScdnVerifyContent(query: DescribeScdnVerifyContentRequest): Promise<DescribeScdnVerifyContentResponse>;
    VerifyScdnDomainOwner(query: VerifyScdnDomainOwnerRequest): Promise<VerifyScdnDomainOwnerResponse>;
}
export default SCDN;
